// component/UserPortfolio/index.js

// Components
import UserPortfolioContainer from './UserPortfolioContainer';
import UserPortfolioView from './UserPortfolioView';

import PortfolioFooter from './PortfolioFooter';


// Helpers
import { analyticsHelper } from './helpers/anal//yticsHelper';

// Services
import { fetchPortfolioData } from './services/portfolioService';

// Redux related imports
import userPortfolioSlice from './userPortfolioSlice';
//import { userPortfolioThunks } from './userPortfolioThunks';

// Exporting components
export {
  UserPortfolioContainer,
  //UserPortfolioView,

  PortfolioFooter,

  // Helpers
  analyticsHelper,
  // Services
  fetchPortfolioData,
  // Redux related exports
  userPortfolioSlice,
 // userPortfolioThunks,
};

// Typically, you might have a default export for the main container component
export default UserPortfolioContainer;
